import styles from './TemplateUrutan.module.css'
import React, { Fragment } from 'react'

const TemplateUrutan = (props) => {
    return (
        <Fragment>
            <div className = {styles.postBox}>
                <div>1. 13 April 2022 - Fulan - HIV - True</div>
            </div>
        </Fragment>
    )
}

export default TemplateUrutan;
